import Home from "./components/Home/home";
import Main from "./components/Main/main";
import "./App.css";

const App = () => {
  return (
    <FoodContext>
      <Router>
        <Switch>
        this will be done without auth
          <Route path="/" exact component={Home} />
          <Route path="/user" exact component={Main} />
        </Switch>
      </Router>
    </FoodContext>
  );
};

export default App;
